    def executeQueryDoc(self):
        if self.comboBox_Hours.currentText() != "-":
            selectedHour = int(self.comboBox_Hours.currentText())
            inputQuery_Opened = "doctorstarthour(" + self.comboBox_Doctors.currentText() + ",X," + self.comboBox_Days.currentText() + ")"
            inputQuery_Closed = "doctorendhour(" + self.comboBox_Doctors.currentText() + ",X," + self.comboBox_Days.currentText() + ")"
            inputQuery_Opened_Output = "doctorstarthour(" + self.comboBox_Doctors.currentText() + "," + str(selectedHour) + "," + self.comboBox_Days.currentText() + ")"
            inputQuery_Closed_Output = "doctorendhour(" + self.comboBox_Doctors.currentText() + "," + str(selectedHour) + "," + self.comboBox_Days.currentText() + ")"
            self.plainTextEdit_2.insertPlainText(f"- Input query: " + inputQuery_Opened_Output + " AND " + inputQuery_Closed_Output )
            self.plainTextEdit_2.insertPlainText("\n\n- Output: ")

            rsO,queryResultOpened = askANDResolve_KB(diseasesKB, inputQuery_Opened)
            rsC,queryResultClosed = askANDResolve_KB(diseasesKB, inputQuery_Closed)

            if "No" in rsO or "No" in rsC:
                self.plainTextEdit_2.insertPlainText("La query effettuata non ha prodotto un risultato con esito positivo." + "\n")
            elif "No" in rsO and "No" in rsC:
                self.plainTextEdit_2.insertPlainText("Il medico da te cercato non è aperto per una visita nel periodo selezionato." + "\n")       
            else:
                openHour = int(queryResultOpened[0])
                print(openHour)
                closeHour = int(queryResultClosed[0])
                if selectedHour >= openHour and selectedHour < closeHour:
                    self.plainTextEdit_2.insertPlainText("Il medico da te cercato al momento risulta aperto." + "\n")    
                elif selectedHour >= closeHour:
                    self.plainTextEdit_2.insertPlainText("Il medico da te cercato al momento risulta chiuso." + "\n")     
                elif selectedHour < openHour:
                    self.plainTextEdit_2.insertPlainText("Il medico da te cercato al momento risulta ancora chiuso. Aprirà presto." + "\n")                          

            self.plainTextEdit_2.insertPlainText('_-_-_-_-_-_-_-_-_-_-_-_-_-_-_-_-__-_-_-_-_-_-_-_-_-_-_-_-_-_-_-_-_\n') 
            return 

        elif self.comboBox_Doctors.currentText() == "Qualunque" and self.comboBox_Days.currentText() == "Qualunque":
            query = "doctorstarthour(X," + self.comboBox_Hours.currentText() + ",X)"
            self.plainTextEdit_2.insertPlainText(f"- Input query: " + query)
        elif self.comboBox_Doctors.currentText() == "Qualunque": 
            query = "doctorstarthour(X," + self.comboBox_Hours.currentText() + self.comboBox_Days.currentText() + ")"   
            self.plainTextEdit_2.insertPlainText(f"- Input query: " + query)
        elif self.comboBox_Days.currentText() == "Qualunque": 
            query = "doctorstarthour(" + self.comboBox_Doctors.currentText() + "," + self.comboBox_Hours.currentText() + ",X)"
            self.plainTextEdit_2.insertPlainText(f"- Input query: " + query)

        self.plainTextEdit_2.insertPlainText("\n\n- Output: ")
        queryResults,a = askANDResolve_KB(diseasesKB, query)
        for result in queryResults:
            if "No" in result:
                self.plainTextEdit_2.insertPlainText("La query effettuata non ha prodotto un risultato con esito positivo." + "\n")
   
